import React from "react";

const Hero = () => {
    return (
        <section className = "hero is-success">
            <div className = "hero-body">
                <div className = "container">
                    <h1 className = "title">初めてのページ作り</h1>
                    <h2 className = "subtitle">bulmaって凄い。</h2>
                </div>
            </div>
        </section>
    );
};

const Message = () => {
    return (
        <article class="message">
            <div class="message-header">
                <p>こんにちわ。</p>
                <button class="delete" aria-label="delete"></button>
            </div>
            <div class="message-body">
                 初めまして。このページは<strong>練習用のページ</strong>です。
            </div>
        </article>
    );
}

const Menu = () => {
    return (
        <aside className = "menu">
            <p className = "menu-label">メニュー</p>
            <ul className = "menu-list">
                <li><a>ボタン</a></li>
            </ul>
        </aside>
    );
}

const Body1 = () => {
    return (
    <section className = "section">
        <div className = "container">
            <h2 className = "subtitle">ボタンの表示をしてみた。</h2>
        </div>
    </section>
    );
}

const Footer = () => {
    return (
        <footer className = "footer">
            <dvi className = "content has-text-centered">
                <p>&copy; 2020 miura</p>
            </dvi>
        </footer>
    );
}

const App = () => {
    return (
        <div>
            <Hero />
            <Menu />
            <Body1 />
            <Footer />
        </div>
    );
};

export default App;
